import Vue from 'vue';
import Router from 'vue-router';
import Home from '@/components/DevNav/index.vue';
Vue.use(Router);
export default new Router({
    routes: [
        {
            path: '/',
            name: 'Home',
            component: Home,
            children: [
                {
                    path: '/index',
                    name: 'index',
                    component: function (resolve) { require(['@/components/DevNav/component/home.vue'], resolve); } //index
                },
                {
                    path: '/gismapexam',
                    name: 'gismapexam',
                    component: function (resolve) { require(['@/components/DevNav/component/GisMapExam/index.vue'], resolve); } //gismapexam //() => import('@/components/DevHome/component/GisMapExam/index.vue') gismapexam
                },
                {
                    path: '/DataTable',
                    name: 'DataTable',
                    component: function (resolve) { require(['@/components/DevNav/component/DataTable/index.vue'], resolve); } //DataTable //() => import('@/components/DevHome/component/DataTable/index.vue')  
                },
                {
                    path: '/threeExam',
                    name: 'threeExam',
                    component: function (resolve) { require(['@/components/DevNav/component/ThreeExam/index.vue'], resolve); } //three// () => import('@/components/DevHome/component/ThreeExam/index.vue') 
                },
                {
                    path: '/paperExam',
                    name: 'paperExam',
                    component: function (resolve) { require(['@/components/DevNav/component/paperExam/index.vue'], resolve); } //three// () => import('@/components/DevHome/component/ThreeExam/index.vue') 
                }
            ]
        }
    ]
});
